window.bookSummaryJSON = "<p><b>No Romance. No Harem. Just Vampires.</b></p> <p>Becoming a knockoff Dracula in tight leather pants was never part of Vincent’s plans. Neither was being summoned to another world by a cult of vampire wannabes. But both happened.</p> <p>Now, Vincent’s left to pick up the tattered pieces of his humanity as he tries to grow strong enough to keep his family safe. The world is filled with nightmares, and the looming threat of losing his soul stands between his goal and his reality, so it’s not like it will be too hard or anything.</p> <p>Hell should tremble.</p> <p>A good man is going to war.</p>"; 
